import "./Hero.css";

const Hero = () => {
  return (
    <section className="hero">
      <h2>Host Your Next DnD Campaign Online</h2>
      <p>Interactive maps, character sheets, live chat, and more.</p>
      <button>Get Started</button>
    </section>
  );
};

export default Hero;
